import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import Nav from './Nav';
import About from './About';
import Shop from './Shop';



function App() {
  return (
   <div className="App">
      <Nav />
      <About />
      <Shop />
   </div> 
  );
}

export default App;
